import React, { Component } from 'react'
import {Form, Input} from 'react-bootstrap'

export class BlankPage extends Component {
  constructor(props) {
    super(props);
      this.state = {url: '',
                    limit: 1};

      this.handleChange = this.handleChange.bind(this);
      this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleChange(event) {
      this.setState({url: event.target.url});
      this.setState({limit: event.target.limit});
    }

    handleSubmit(event) {
      console.log("making request")
      fetch('/result')
        .then(response => {
          console.log(response)
          return response.json()
        })
        .then(json => {
        console.log=(json)
        this.setState({url: json[0]})
        })
    }

  render() {
    return (
      <div className="card">
               <div className="card-body">
                <h4 className="card-title">YouTube Comment Sentiment Analysis</h4>
                <form className="forms-sample" onSubmit={this.handleSubmit} action="http://localhost:5000/predict" method="get">
                  <Form.Group className="row">
                    <label htmlFor="exampleInputUsername2" className="col-sm-3 col-form-label">Video ID</label>
                    <div className="col-sm-9">
                    <Form.Control type="text" className="form-control" value={url} onChange={e => setUrl(e.target.value)}
                     id="exampleInputUsername2" placeholder="Video Id" />
                    </div>
                  </Form.Group>
                  <Form.Group className="row">
                    <label htmlFor="exampleInputEmail2" className="col-sm-3 col-form-label">Number of Comments</label>
                    <div className="col-sm-9">
                    <Form.Control type="email" className="form-control" value={limit} onChange={e => setLimit(e.target.value)} id="exampleInputEmail2" placeholder="Number of Comments" />
                    </div>
                  </Form.Group>

                  <button type="reset" className="btn btn-secondary mr-2">Reset</button>
                  <button type="submit" className="btn btn-primary mr-2" onChange={this.handleChange} url={this.state.url}> Submit </button>

                </form>
                <h1> limit: {this.state.limit} </h1>
              </div> 
            </div>
    )
  }
}

export default BlankPage
